            <div className="modal">
                <a className="close" onClick={close}>
                &times;
                </a>
                <div className="header"> acola.me </div>
                <div className="content">
                    Su post ha sido eliminado con Ã©xito
                </div>
                <div className="actions">
                <button
                    className="button"
                    onClick={() => {
                    close();
                    }}
                >
                    Okay
                </button>
                </div>
            </div>
            )}
        </Popup>
    );
}

